import React, { FC } from 'react';

interface NavigationProps {
  title: string;
}

const Navigation: FC<NavigationProps> = ({ title }) => {
  return (
    <nav className=" flex-row bg-red relative container p-6 justify-between mx-auto underline text-3x1">
      <h1 className="bg-black underline"><a href="resume.pdf" target="_blank" download>{title}</a></h1>
      <h1>{title}</h1>
      <h1>{title}</h1>
      <h1>{title}</h1>
    </nav>
  );
};

export default Navigation;
